import React from 'react'
import * as S from './styles'
import logo from '../../assets/logo.png'

function Home(){

    return(
        <S.Container>
            <img src={logo} alt="logo" />
            <button>Cadastre-se</button>
            <button>Login</button>
        </S.Container>
    )
}

export default Home
